import { Link } from "react-router-dom";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faTrash } from "@fortawesome/free-solid-svg-icons";
const Side = ({ taskLists,deleteList }) => {

  return (
    <ul>

      {taskLists.map((list) => (
        <li>
          <Link to={list.id} >
            <span>

              {list.name}
            </span>
            {/* <span>NUMBER OF TASKS</span> */}
          </Link>
        </li>
      ))}
    </ul>
  );
};

export default Side;
